import React from 'react'

export default function Posts({posts,loading}) {
    if(loading)
    {
        return <h2>Loading...</h2>
    }
    return (
        <div>
                  <ul className='list-group mb-4'>
                        {
                            posts.map((value,index)=>{
                                return (
                                <li className='list-group-item'>{value.name}</li>
                                )
                            })
                        }
                 </ul>  
        </div>
    )
}
